def doubler(n, cmd='', err=False):
    if n == 1:
        return '', True
    if n % 2 == 1 and not err:
        return f'Error: Odd number encountered at {cmd}!\n', False
    if n == 2:
        return '', True
    return f'{cmd}:2\n', doubler(n // 2, f'{cmd}-1\n', False)

