    visited = [False] * n
    prev = [None] * n

    for i in range(n):
        if not visited[i]:
            queue = [i]
            visited[i] = True

            while queue:
                current = queue.pop(0)

                for j in range(n):
                    if adj_matrix[current][j] == 1 and not visited[j]:
                        queue.append(j)
                        visited[j] = True
                        prev[j] = current

    return prev

