    ways = 0
    for i in range(s1 + 1):
        for j in range(min(i, s2)):
            for k in range(min(j, s3)):
                if n == i + j + k:
                    ways += 1
    for filling in fillings:
        if filling == 'sausage':
            s1 -= 1
        elif filling == 'cheese':
            s2 -= 1
        else:
