def get_operations(s, target):
  operations = 0
  i = 0
  j = 0
  while i < len(s) and j < len(target):
    if s[i] == target[j]:
      i += 1
      j += 1
    elif s[i] * 2 == target[j:j+2]:
      operations += 1
      i += 1
      j += 2
    elif s[i:i+2] == target[j]:
      operations += 1
      i += 2
      j += 1
    else:
      return -1
  if i < len(s) or j < len(target):
