def max_bonus(n):
    plots = [0] * (n + 1)
    for i in range(1, n + 1):
        for j in range(i, n + 1):
            k = i * j
            if k > n:
                break
            plots[k] = max(plots[k], plots[i - 1] + 1)
    for i in range(n + 1, len(plots)):
        plots[i] = plots[i - 1] + 1
    return plots[n]

