    if n == 1:
        return p
    else:
        key = 1
        while p % 2 == 0:
            p //= 2
            key *= 2
        i = 3
        while i * i <= p:
            if p % i == 0:
                key *= i
                p //= i
            else:
                i += 2
        if p > 1:
            key *= p
        return key + (n - 1)

