def dominoes(m, n):
    if m < n:
        m, n = n, m

    dp = [[0] * n for _ in range(m)]
    dp[0][0] = 1

    for i in range(1, m):
        for j in range(min(i+1, n)):
            for k in range(j):
                dp[i][j] += dp[i-k-1][k]

    return sum(row[-1] for row in dp)

