def find_word(table, word, visited):
    n = len(table)
    for i in range(n):
        for j in range(n):
            if table[i][j] == word[0] and (i, j) not in visited:
                if len(word) == 1:
                    return True
                else:
                    visited.add((i, j))
                    for k in range(1, len(word)):
                        found = False
                        for x, y in [(i + 1, j), (i - 1, j), (i, j + 1), (i, j - 1)]:
                            if 0 <= x < n and 0 <= y < n and table[x][y] == word[k] and (x, y) not in visited:
                                found = True
                                visited.add((x, y))
                                break
                        if not found:
                            visited.remove((i, j))
                            return False
                    return True
    return False

def solve_puzzle(table, words):
    n = len(table)
    visited = set()
    for word in words:
        if find_word(table, word, visited):
            for i in range(n):
                for j in range(n):
                    if (i, j) in visited:
                        table[i][j] = " "
    remaining_letters = []
    for i in range(n):
        for j in range(n):
            if table[i][j] != " ":
                remaining_letters.append(table[i][j])
    return sorted(remaining_letters)

