def solve(n, k, q, a):
    dp = [[0] * (q + 1) for _ in range(n + 1)]
    dp[0][a[0]] = 1

    for i in range(1, n + 1):
        for j in range(min(q, a[i]), -1, -1):
            dp[i][j] += dp[i - 1][j]
        for j in range(q, -1, -1):
            if i >= k:
                dp[i][j] += dp[i - k][j]

    return sum(dp[n][q:])

