        for i in range(n):
            for j in range(i+1, n):
                a[i], a[j] = a[j], a[i]
                if (i % 2 == 0 and j % 2 == 1) or (i % 2 == 1 and j % 2 == 0):
                    new_odd_sum = odd_sum - a[i] + a[j]
                    new_even_sum = even_sum - a[j] + a[i]
                    if new_odd_sum == new_even_sum:
                        return "Yes"
                a[i], a[j] = a[j], a[i]
    return "No"

