def dijkstra(n, weights, start):
    inf = float('inf')
    dist = [inf] * n
    dist[start] = 0
    visited = [False] * n

    for _ in range(n):
        min_dist = inf
        u = -1
        for i in range(n):
            if not visited[i] and dist[i] < min_dist:
                min_dist = dist[i]
                u = i

        if u == -1:
            break

        visited[u] = True

        for v in range(n):
            if weights[u][v] != -1 and not visited[v]:
                new_dist = dist[u] + weights[u][v]
                if new_dist < dist[v]:
                    dist[v] = new_dist

    result = []
    for i in range(n):
        if i != start:
            if dist[i] == inf:
                result.append(f"{i+1} NO")
            else:
                result.append(f"{i+1} {dist[i]}")

    return result

