def minimum_time(N, A, B):
    low, high = 1, N

    def can_complete_in_time(time):
        return (time // A + time // B) * A * B >= N * A * B

    while low < high:
        mid = (low + high) // 2
        if can_complete_in_time(mid):
            high = mid
        else:
            low = mid + 1

    return low

